import React from 'react';

const invoice =(props)=>{
    return (
        <div>
            <div>Id :{props.invoice.id}</div>
            <div>Name :{props.invoice.name}</div>
            <div>Product :{props.invoice.product}</div>
            <div>Price :{props.invoice.price}</div>
        </div>
    )
}

export default invoice;
